class Solution {
public:
    vector<vector<int>> updateMatrix(vector<vector<int>>& mat) {
        int n = mat.size();
        int m = mat[0].size();

        vector<vector<int>> dis(n, vector<int>(m, -1));

        queue<pair<int,int>> q;
        // queue<int> rq, cq;
 
        for(int i=0; i<n; i++) {
            for(int j=0; j<m; j++) {
                if(mat[i][j] == 0) {
                    dis[i][j] = 0;
                    q.push({i,j});
                }
            }
        }

        vector<vector<int>> d = {
            {0, 1},
            {0,-1},
            {1,0},
            {-1,0}
        };
        // i, j

        while(!q.empty()) {
            int row = q.front().first, col = q.front().second;
            assert(dis[row][col] != -1);
            q.pop();
            
            // cout << row << ' ' << col << "\n";

            for(int i=0; i<4; i++) {

                int nextR = row + d[i][0];
                int nextC = col + d[i][1];

                if(nextR >= 0 && nextR < n && nextC >= 0 && nextC < m) {
                    if(dis[nextR][nextC] == -1) {
                        q.push({nextR, nextC});
                        assert(mat[nextR][nextC]==1);
                        
                        dis[nextR][nextC] = 1 + dis[row][col];
                    } 
                }

            }

        }
        return dis;
    }
};

